import * as React from 'react';
import AppBar from '@mui/material/AppBar';
import Button from '@mui/material/Button';
import CameraIcon from '@mui/icons-material/PhotoCamera';
import Card from '@mui/material/Card';
import CardActions from '@mui/material/CardActions';
import CardContent from '@mui/material/CardContent';
import CardMedia from '@mui/material/CardMedia';
import CssBaseline from '@mui/material/CssBaseline';
import Grid from '@mui/material/Grid';
import Stack from '@mui/material/Stack';
import Box from '@mui/material/Box';
import Toolbar from '@mui/material/Toolbar';
import Typography from '@mui/material/Typography';
import Container from '@mui/material/Container';
import Link from '@mui/material/Link';
import MenuBookIcon from '@mui/icons-material/MenuBook';
import {createTheme, ThemeProvider} from '@mui/material/styles';
import background from "../images/background.jpg";
import {Book, Fandom} from "../Models/Fandom";
import NavBar from "./NavBar";
import {useParams} from "react-router-dom";
import {useEffect, useState} from "react";

function Copyright() {
  return (
    <Typography variant="body2" color="text.secondary" align="center">
      {'Copyright © '}
      <Link color="inherit" href="https://mui.com/">
        ReadFic
      </Link>{' '}
      {new Date().getFullYear()}
      {'.'}
    </Typography>
  );
}

const theme = createTheme();

export default function BookView() {
  let { pk } = useParams();
  const [book, setBook] = useState<Book>()
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState(null);

  useEffect(() => {
    const fetchFandoms = async () => {
      try {
        const response = await fetch(
          `http://127.0.0.1:8000/api/v1.0/books/${pk}/`
        );
        if (!response.ok) {
          throw new Error(`This is an HTTP error: The status is ${response.status}`);
        }
        let actualData = await response.json();
        setBook(actualData);
        console.log(actualData)
      } catch (err) {
        // @ts-ignore
        setError(err.message);
      } finally {
        console.log('f')
      }
    }
    fetchFandoms()
  }, [])

  // @ts-ignore
  return (
    <ThemeProvider theme={theme}  >
      <CssBaseline/>
      <NavBar/>
      <main style={{backgroundImage: `url(${background})`}}>
        <Box sx={{bgcolor: 'background.paper', pt: 8, pb: 6,}}>
          <Grid container spacing={2}>
            <Grid item xs={3} sx={{p: 2, textAlign: "center"}} alignItems="center" >
              <Box component="img" alt="The house from the offer." src={`${!!book ? book.cover : ''}`} alignItems="center"
                   sx={{height: 360, width: 240,
                     maxHeight: {xs: 360, md: 300}, maxWidth: {xs: 240, md: 200}}}
              />
            </Grid>
            <Grid item xs={9} sx={{pl: 2, pb: 2, pr: 2}}>
              <Typography component="h4" variant="h4" align="center" color="text.primary" sx={{pb: 3, py: 1}}>
                {!!book ? book.title : ''}
              </Typography>
              <Typography align="left" color="text.primary" sx={{px: 3,pt:1, maxHeight: {xs: 233, md: 167}}}>
                <strong>Описание: </strong>{!!book ? book.desc : ''}
              </Typography>
              <Typography align="left" color="text.primary" sx={{px: 3, maxHeight: {xs: 233, md: 167}}}>
                <strong>Автор: </strong>{!!book ? book.author.username : ''} ({!!book ? book.author.first_name : ''} {!!book ? book.author.last_name : ''})
              </Typography>
              <Typography align="left" color="text.primary" sx={{px: 3,maxHeight: {xs: 233, md: 167}}}>
                <strong>Жанр: </strong>{!!book ? book.genre : ''}
              </Typography>
              <Typography align="left" color="text.primary" sx={{px: 3, maxHeight: {xs: 233, md: 167}}}>
                <strong>Категория: </strong>{!!book ? book.category : ''}
              </Typography>
              <Typography align="left" color="text.primary" sx={{px: 3, maxHeight: {xs: 233, md: 167}}}>
                <strong>Фандом: </strong>{!!book ? book.fandoms.name : ''}
              </Typography>
            </Grid>
          </Grid>
        </Box>
        <Container sx={{py: 8}} maxWidth="xl">
          <Grid container spacing={4}>
            <Grid item key="1" xs={12} sm={12} md={12}>
              <Card sx={{height: '100%', display: 'flex', flexDirection: 'column', p: 7}}>
                <Typography align="center" color="text.primary">
                  {!!book ? book.content : ''}
                </Typography>
              </Card>
            </Grid>
          </Grid>
        </Container>
      </main>
      <Box sx={{bgcolor: 'background.paper', p: 6}} component="footer">
        <Copyright/>
      </Box>
    </ThemeProvider>
  );
}
